import React from "react";
import "./App.css"
import abo from './images/abo.jpg'



const Contact=()=>{
    return(
        <div className="contact">
           <div>
            <h1>Contact us</h1>
            
                <h3>AKSHAY PEDNEKAR</h3>
                <p>Mobile No:-9152678498</p>
                <p>Email-id     :- asquarehydro@gmail.com</p>
            </div>
            <div>
                <img src={abo} alt='' />

            </div>
        </div>


    )
}

export default Contact;
